#Q1 - v1
#SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes group by district,ward,cblock,community_area,beat) a where cnt >= %i and cnt <= %i
def q1(outS,outE):
    q = "SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes group by district,ward,cblock,community_area,beat) a where cnt >= " + str(outS) + " and cnt <= " + str(outE)

    return q

#Q2 - v2
#query
#SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes where ward >= %i and ward < %i group by district,ward,cblock,community_area,beat) a where cnt >=%i and cnt <= %i
def q2(inS,inE,outS,outE):
    q = "SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes where ward >= " + str(inS) + " and ward < " + str(inE) + " group by district,ward,cblock,community_area,beat) a where cnt >= " + str(outS) + " and cnt <= " + str(outE)

    return q


#Q3 - v3 two parameters
#SELECT * FROM (
#   SELECT * FROM (
#       SELECT district,ward,cblock,community_area,beat, count(*) AS cnt
#       FROM crimes where cyear >= %i
#       group by district,ward,cblock,community_area,beat) a
#   order by cnt desc) b
#limit $i;
def q3(inPara,outPara):
    q = "SELECT * FROM (SELECT * FROM (SELECT district,ward,cblock,community_area,beat, count(*) AS cnt FROM crimes where cyear >= " + str(inPara) + " group by district,ward,cblock,community_area,beat) a order by cnt desc) b limit " + str(outPara)

    return q


#Q4 - v4 three parameters
#SELECT * FROM (
#   SELECT district,ward,cblock,community_area,beat, count(*) AS C
#   FROM crimes
#   where cyear >= %i and cyear <= %i
#   group by district,ward,cblock,community_area,beat) a
#where C >= %i;
def q4(inS,inE,outPara):
    q = "SELECT * FROM (SELECT district,ward,cblock,community_area,beat, count(*) AS C FROM crimes where cyear >= " + str(inS) + " and cyear <= " + str(inE) + " group by district,ward,cblock,community_area,beat) a where C >= " + str(outPara)

    return q



#Q5 - v5
#query
#SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes where community_area >= %i and community_area < %i and cyear >= %i group by district,ward,cblock,community_area,beat) a where cnt >=%i and cnt <= %i
def q5(inS,inE,in2,outS,outE):
    q = "SELECT * FROM (SELECT district,ward,cblock,community_area,beat,count(*) as cnt FROM crimes where community_area >= " + str(inS) + " and community_area < " + str(inE) + " and cyear >= " + str(in2) + " group by district,ward,cblock,community_area,beat) a where cnt >= " + str(outS) + " and cnt <= " + str(outE)

    return q



