def q1_run(i):
    print >> f,  ("--------------Q1------------- : " + str(i))
    pp = "Q1: "
    bestPSLen = 999999
    bestInS = 0
    bestInE = 0
    curInS = itvl1[i][0]
    curInE = itvl1[i][1]
    query = q1(curInS,curInE)
    print >> f,  "current interval [" + str(curInS) + "," + str(curInE) + "] \n"

    #declare global
    global cum_cost1
    global orig_cum_cost1

    global cum_cost
    global orig_cum_cost
    global pArray
    global numUse
    global numUse_PS
    global numUse_Nor

    global totalUseCost
    global totalUseCost_PS
    global totalUseCost_Nor

    global numCap
    global numCap_Use_PS
    global numCap_Use_Nor

    global totalCapCost
    global totalCapCost_UsePS
    global totalCapCost_UseNor

    global dict1

    mark_0 = 0
    for key in dict1.keys():
        fcurInS = key[0]
        fcurInE = key[1]
        if(curInS >= fcurInS and curInE <= fcurInE):
            curPSLen = getPSLen(dict1[key])
            if(curPSLen == 0):
                mark_0 = 1
            if(bestPSLen > curPSLen and curPSLen != 0):
                bestPSLen = curPSLen
                bestInS = fcurInS
                bestInE = fcurInE
    print >> f,    "bestInS:" + str(bestInS) + ", bestInE:" + str(bestInE) + "\n"

    if(bestPSLen == 999999 and mark_0 == 0):
        #run capture
        print >> f,    ("--------------Capture and Use PS-------------")
        result_cap = getPS(query)
        dict1[curInS,curInE] = result_cap

        #calculate cost: cost = cap cost + use cost
        print >> f,    ("\n" + "running cap cost" )
        cost_cap = capCost(query)
        cum_cost = cost_cap + cum_cost
        cum_cost1 = cost_cap + cum_cost1
        totalCapCost = totalCapCost + cost_cap
        numCap = numCap + 1
        print >> f,    ("cap cost is " + str(cost_cap))
        pp = pp + " cap cost:" + str(cost_cap)
        print >> f,    ("Current total cost is " + str(cum_cost))

        print >> f,    ("running use cost" + "\n")
        if(getPSLen(result_cap) == 0):
            orig_cost = time_query(query)
            cum_cost = orig_cost + cum_cost
            cum_cost1 = orig_cost + cum_cost1
            print >> f,    (" zero use cost is " + str(orig_cost))
            print >> f,    (" zero total cost is " + str(cum_cost))
            pp = pp + " zero use cost:" + str(orig_cost)
            pp = pp + " zero current total cost:" + str(cum_cost)
            print >> f,    ("Current total cost is " + str(cum_cost))
            totalCapCost_UseNor = totalCapCost_UseNor + orig_cost
            numCap_Use_Nor = numCap_Use_Nor + 1
        else:
            cost_use = useCost(query,result_cap)
            cum_cost = cost_use + cum_cost
            cum_cost1 = cost_use + cum_cost1
            numTuplePS = numTupInPS(result_cap)
            print >> f,    ("use cost is " + str(cost_use))
            print >> f,    ("total cost is " + str(cum_cost))
            print >> f,    ("number of tuples in ps " + numTuplePS)
            pp = pp + " use cost:" + str(cost_use)
            pp = pp + " current total cost:" + str(cum_cost)
            pp = pp + " number of tuples in ps:" + numTuplePS
            numCap_Use_PS = numCap_Use_PS + 1
            totalCapCost_UsePS = totalCapCost_UsePS + cost_use
            print >> f,    ("Current total cost is " + str(cum_cost))
    else:
        #run use
        print >> f,    ("\n" + "--------------Only Use PS-------------" )
        print >> f,    "bestInS:" + str(bestInS) + ", bestInE:" + str(bestInE) + "\n"
        pp = pp + "bestIn:[" + str(bestInS) + "," + str(bestInE) + "] ..."

        #get ps from dictionary
