            print >> f,   (" zero use cost is " + str(orig_cost))
            print >> f,   (" zero total cost is " + str(cum_cost))
            pp = pp + " zero use cost:" + str(orig_cost)
            pp = pp + " zero current total cost:" + str(cum_cost)
            numUse_Nor = numUse_Nor + 1
